import React from "react";

/*
export default function Home() {
  return (
    <div>
      <h1>___Electiva_2__</h1>
      <h6>
        
      </h6>
    </div>

  );
}
*/

import { Carousel } from 'antd';
const contentStyle = {
  height: '250px',
  color: '#fff',
  lineHeight: '160px',
  textAlign: 'center',
  background: '#000000',
};

const App = () => (
  <Carousel autoplay>
    <div>
      <center><h3 style={contentStyle}><img alt="example" src="data:image/jpeg;base64," /></h3></center>
    </div>
    <div>
      <h3 style={contentStyle}><img alt="example" src="data:image/jpeg;base64," /></h3>
    </div>
    <div>
      <h3 style={contentStyle}><img alt="example" src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ2O_a6_OUIRATTJt_deBCpIAmI6RuELRcFhw&usqp=CAU" /></h3>
    </div>
    <div>
      <h3 style={contentStyle}><img alt="example" src="data:image/jpeg;base64," /></h3>
    </div>
  </Carousel>
);

export default App;
